import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'


import Home from "./pages/home";

function App() {
  return <div className='App'>
    <Router>
      <Switch>
        <Route patch="/" exact component={Home}/>
      </Switch>
    </Router>
    </div>;
}

export default App;
